import React from 'react';

const foodILike = [
  {
    name : "kimchi",
    url : ""    
  },
  {
    name : "ramen",
    url : ""    
  },
  {
    name : "samgusal",
    url : ""    
  }
];

function Food({name}) {
return <h1>I like {name}</h1>;
}

function App() {
  return (
    <div className="App">hello
    {foodILike.map(dish => <Food name={dish.name} />)}
    </div>
  );
}

export default App;
